import React from "react";
import "./output.css";

function DescText(props) {
  return (
    <div className="w-auto max-w-[300px] relative flex flex-col items-center">
      <div
        className={`${props.textSize || "text-lg"} ${
          props.textColor || "text-[#d9d9d9]"
        } font-normal font-outfit leading-tight text-center`}
      >
        {props.text}
      </div>
    </div>
  );
}

export default DescText;
